function Journies({ sessions }) {
  return (
    <div style={{paddingTop: '10vh', backgroundClip: 'content-box', width: '70vw', height: '70vh', backgroundColor: 'rgb(10,10,10)'}}>
      {sessions.map(s =>
        <Session session={s}/>
      )}
    </div>
  )
}

function Session({ meta }) {
  return (<div style={{height: '25px', paddingLeft: '20px', display: 'flex', gap: '8px'}}>
    <p style={{color: 'rgb(0,192,0)'}}>+ ${meta.result}</p>
    <p style={{color: 'rgb(40,40,40)'}}>&mdash;</p>
    <p style={{color: 'rgb(190,190,190)'}}>{meta.stakes} @ {meta.loc}</p>
    <p style={{color: 'rgb(40,40,40)'}}>&mdash;</p>
    <p style={{color: 'rgb(190,190,190)'}}>{meta.date}</p>
    <p style={{color: 'rgb(40,40,40)'}}>&mdash;</p>
    <p style={{color: 'rgb(190,190,190)'}}>{meta.dur}</p>
  </div>)
}

export { Journies }
